import "./App.css";

function App() {
  return (
    <>
      <h1>Far Away</h1>
      <div>
        <h2>What do you need for your trip</h2>
        <select>
          <input type='option'>1</input>
        </select>
      </div>
    </>
  );
}

export default App;
